import React from 'react';
import NavBar from '../NavBar/NavBar';
import Footer from '../Footer/Footer';
import './Home.scss';

export default function Home() {
    return (
        <div className="home">
            <NavBar />
                <h1>Plant Lives Matter</h1>
            <Footer />
        </div>
    )
}
